import React, {Component} from 'react';
import Jumbotron from 'react-bootstrap/Jumbotron';

import "./css/AboutPage.css";

class AboutPage extends Component {
  render(){
    return(
      <div>
        <Jumbotron className="lineargradient-rainbow135 about-title-container">
            <div className="align-item-center" >
              <h1 style={{fontFamily:"RobotoMonoB", fontSize:"60px"}}>
                Who We Are
              </h1>
            </div>
            <br/>
            <div className="align-item-center">
              <h3 className="align-item-center" style={{fontFamily:"RobotoMono", fontSize:"30px"}}>
                Some nice catchy line
              </h3>
            </div>
        </Jumbotron>
      </div>
    );
  }
}

export default AboutPage;
